Buku ini juga sudah berkali-kali direview dan direkomendasikan. Didalamnya dijelaskan berbagai seluk beluk saham yang mungkin dirasa sulit, tapi dijamin tidak akan cepat bosan baca buku ini. Dilengkapi juga dengan berbagai ilustrasi perhitungan untuk memilih #saham yang baik.

Penasaran tentang perdagangan saham? Beli sendiri ya bukunya. Soalnya cepat habis kalau dicetak ulang. Apalagi, biasanya di toko online hanya bajakannya saja yang ada. Tidak mau kan baca buku bajakan?

